  WHERE
    date(object_data.Datestamp) < curdate() - INTERVAL 9 DAY
    AND CharacterID = 0
    AND (Inventory = '[]'
    OR (Inventory = '[[[],[]],[[],[]],[[],[]]]'
    AND Classname = 'TentStorage'));

  UPDATE object_data, character_data
  SET
    object_data.characterID = 0, object_data.Datestamp = curdate()
  WHERE
    object_data.CharacterID = character_data.CharacterID
    AND character_data.Alive = 0
    AND date(character_data.Datestamp) < curdate() - INTERVAL 3 DAY;

  UPDATE object_data, character_data
