--
-- Definition for procedure pCleanupOOB
--
DROP PROCEDURE IF EXISTS pCleanupOOB$$
CREATE DEFINER = 'root'@'localhost'
PROCEDURE pCleanupOOB()
BEGIN

  DECLARE intLineCount  INT DEFAULT 0;
  DECLARE intDummyCount INT DEFAULT 0;
  DECLARE intDoLine     INT DEFAULT 0;
  DECLARE intWest       INT DEFAULT 0;
  DECLARE intNorth      INT DEFAULT 0;

  SELECT count(*)
  INTO
    intLineCount
  FROM
    object_data;

  SELECT count(*)
  INTO
    intDummyCount
  FROM
    object_data
  WHERE
    Classname = 'dummy';

  WHILE (intLineCount > intDummyCount)
  DO

    SET intDoLine = intLineCount - 1;

    SELECT ObjectUID
         , Worldspace
    INTO
      @rsObjectUID, @rsWorldspace
    FROM
      object_data
    LIMIT
      intDoLine, 1;

    SELECT replace(@rsWorldspace, '[', '')
    INTO
      @rsWorldspace;
    SELECT replace(@rsWorldspace, ']', '')
    INTO
      @rsWorldspace;
    SELECT replace(substring(substring_index(@rsWorldspace, ',', 2), length(substring_index(@rsWorldspace, ',', 2 - 1)) + 1), ',', '')
    INTO
      @West;
    SELECT replace(substring(substring_index(@rsWorldspace, ',', 3), length(substring_index(@rsWorldspace, ',', 3 - 1)) + 1), ',', '')
    INTO
      @North;

    SELECT instr(@West, '-')
    INTO
      intWest;
    SELECT instr(@North, '-')
    INTO
      intNorth;

    IF (intNorth = 0) THEN
      IF (@North = NULL) THEN
        SET @North = '';
        SELECT convert(@North, DECIMAL(16, 8))
        INTO
          intNorth;
      END IF;
      IF (@North != NULL) THEN
        SELECT convert(@North, DECIMAL(16, 8))
        INTO
          intNorth;
      END IF;
    END IF;

    IF (intWest > 0 OR intNorth > 15360) THEN
      DELETE
      FROM
        object_data
      WHERE
        ObjectUID = @rsObjectUID;
    END IF;

    SET intLineCount = intLineCount - 1;

  END WHILE;

END
$$

