--
DROP PROCEDURE IF EXISTS pFixMaxNum$$
CREATE DEFINER = 'root'@'localhost'
PROCEDURE pFixMaxNum()
BEGIN

  DECLARE iCounter INT DEFAULT 0;

  SELECT count(*)
  INTO
    @iClassesCount
  FROM
    object_classes
  WHERE
    Classname <> '';
  WHILE (iCounter < @iClassesCount)
  DO
    SELECT Classname
         , MaxNum
    INTO
      @Classname, @MaxNum
    FROM
      object_classes
    LIMIT
      iCounter, 1;
    SELECT count(*)
    INTO
      @iMaxClassSpawn
    FROM
      object_spawns
    WHERE
      Classname LIKE @Classname;
    IF (@MaxNum > @iMaxClassSpawn) THEN
      UPDATE object_classes
      SET
        MaxNum = @iMaxClassSpawn
      WHERE
        Classname = @Classname;
    END IF;
    SET iCounter = iCounter + 1;
  END WHILE;

END
$$

